import React from 'react';
import '../App.css';

import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
     <header className="App-header">
	<img src="/images/ecuteachers.jpg" width="100%" alt="Not found" />
	<form method="get" action="/ShoppingList">
        <button
          className="App-link"
	  type= "submit"
        >
          Echa un vistazo a la tienda!
        </button>
	</ form>
      </header> 
    </div>
  );
}

export default App;
